create table team_attendance
(
    n4_id        integer generated by default as identity
        primary key,
    n4_play      smallint not null,
    n4_win       smallint not null,
    n4_draw      smallint not null,
    n4_lost      smallint not null,
    n4_score     smallint not null,
    n4_conceded  smallint not null,
    n4_banned    smallint not null,
    n4_season    smallint not null,
    n4_league_id integer
        constraint team_attendance_n4_league_id_af4d95e7_fk_league_n4_id
            references league
            deferrable initially deferred,
    n4_team_id   integer
        constraint team_attendance_n4_team_id_f0fd75d9_fk_team_n4_id
            references team
            deferrable initially deferred
);

alter table team_attendance
    owner to pldjango;

create index team_attendance_n4_league_id_af4d95e7
    on team_attendance (n4_league_id);

create index team_attendance_n4_team_id_f0fd75d9
    on team_attendance (n4_team_id);

create unique index idx_team_attendance_unique
    on team_attendance (n4_team_id, n4_league_id, n4_season);

